import React, { useState } from 'react'
import './style.css'
import AddressImg from './images/icons8-address-48.png'
import { Link } from 'react-router-dom';
import resImg from './images/icons8-restaurant-48 (1).png'
import resNei from './images/icons8-email-30.png'
import vegorNonveg from './images/icons8-yes-or-no-100.png'
import desImg from './images/icons8-description-64.png'
import fileImg from './images/icons8-file-64.png'
import LocaImg from './images/icons8-location-64.png'

function Addrestaurant() {

  const [ferr, setErr] = useState({})
  const [isSubmited, setSubmit] = useState(false);
  const [input, setInput] = useState({
    resName: "",
    neighborhood: "",
    features: "",
    ftype: "",
    description: "",
    location: ""
  })

  const HandleInputChange = (e) => {
    const name = e.target.rname;
    const value = e.target.value;
    setInput({ ...input, [name]: value });

  }

  const validateForm = (values) => {
    const errors = {}
    const resnamePattern = /^[a-zA-Z ]{5,20}_?[a-zA-Z ]*$/;
    const neighborhoodPattern = /^[a-zA-Z ]{5,20}_?[a-zA-Z ]*$/;
    const featuresPattern = /^[a-zA-Z0-9 ]{5,30}_?[a-zA-Z0-9 ]*$/;
    const ftypePattern = /^[a-zA-Z ]{5,20}_?[a-zA-Z ]*$/;
    const descriptionPattern = /^[a-zA-Z0-9 ]{5,100}_?[a-zA-Z0-9 ]*$/;
    const locationPattern = /^[a-zA-Z ]{5,20}_?[a-zA-Z ]*$/;



    if (!values.name) {
      errors.resName = 'Restuarant name is required'
    }
    else if (!resnamePattern.test(values.resName)) {
      errors.resName = 'Enter 5 to 20 letter'
    }
    if (!values.neighborhood) {
      errors.neighborhood = 'Restuarant name is required'
    }
    else if (!neighborhoodPattern.test(values.neighborhood)) {
      errors.neighborhood = 'Enter 5 to 20 letter'
    }
    if (!values.features) {
      errors.features = 'Restuarant name is required'
    }
    else if (!featuresPattern.test(values.features)) {
      errors.features = 'Enter 5 to 30 letter'
    }
    if (!values.ftype) {
      errors.ftype = 'Restuarant name is required'
    }
    else if (!ftypePattern.test(values.ftype)) {
      errors.ftype = 'Enter 5 to 20 letter'
    }
    if (!values.description) {
      errors.description = 'Restuarant name is required'
    }
    else if (!descriptionPattern.test(values.description)) {
      errors.description = 'Enter 5 to 100 letter'
    }
    if (!values.location) {
      errors.location = 'Restuarant name is required'
    }
    else if (!locationPattern.test(values.location)) {
      errors.location = 'Enter 5 to 20 letter'
    }

  }

  // const submitForm = () => {
  //   if (Object.keys(ferr).length == 0 && isSubmited) {

  //   }
  // }

  const HandleSubmit = (e) => {
    e.preventDefault()
    setErr(validateForm(input))
    setSubmit(true)
    // submitForm()
  }

  return (
    <div className='Signup'>
      <div className='Signup-sub'>
        <form action=""  onSubmit={HandleSubmit}>
          <div className='input-sty-prnt'>
            <div className='sing-head'>
              <h1>Add Restuarants</h1>
              <h5>Add</h5>
            </div>


            <div className='input-sty'>
              <label htmlFor="" style={{ 'textAlign': 'center' }}><b> Restuarants name</b></label>
              <div className='img-inp'>
                <img className='iconsLo' src={resImg} alt="" />
                <input type="text"
                  onChange={HandleInputChange}
                  name='rname'
                  value={input.value}
                />
              </div>
            </div>
            <span className='error-message'>{ferr.resName}</span>
            <div className='input-sty'>
              <label htmlFor="" style={{ 'textAlign': 'center' }}><b>Neighborhood</b></label>
              <div className='img-inp'>
                <img className='iconsLo' src={resNei} alt="" />
                <input type="text"
                  onChange={HandleInputChange}
                  value={input.value}
                  name='neighborhood'
                />
              </div>
            </div>
            <span className='error-message'>{ferr.neighborhood}</span>
            <div className='input-sty'>
              <label htmlFor="" style={{ 'textAlign': 'center' }}><b>Features</b></label>
              <div className='img-inp'>
                <img className='iconsLo' src={AddressImg} alt="" />
                <input type="text"
                  onChange={HandleInputChange}
                  value={input.value}
                  name='features'
                />
              </div>
            </div>
            <span className='error-message'>{ferr.ftype}</span>
            <div className='input-sty'>
              <label htmlFor="" style={{ 'textAlign': 'center' }}><b>Type</b></label>
              <div className='img-inp'>
                <img className='iconsLo' src={vegorNonveg} alt="" />
                <input type="text"
                  onChange={HandleInputChange}
                  value={input.value}
                  name='ftype'
                />
              </div>
            </div>
            <span className='error-message'>{ferr.rtype}</span>
            <div className='input-sty'>
              <label htmlFor="" style={{ 'textAlign': 'center' }}><b>Description</b></label>
              <div className='img-inp'>
                <img className='iconsLo' src={desImg} alt="" />
                <input type="text"
                  onChange={HandleInputChange}
                  value={input.value}
                  name='descripton'
                />
              </div>
            </div>
            <span className='error-message'>{ferr.description}</span>
            <div className='input-sty'>
              <label htmlFor="" style={{ 'textAlign': 'center' }}><b>Location</b></label>
              <div className='img-inp'>
                <img className='iconsLo' src={LocaImg} alt="" />
                <input type="text"
                  onChange={HandleInputChange}
                  value={input.value}
                  name='location'
                />
              </div>
            </div>
            <span className='error-message'>{ferr.location}</span>
            <div className='input-sty'>
              <label htmlFor="" style={{ 'textAlign': 'center' }}><b>Choose  photos:</b></label>
              <div className='img-inp'>
                <img className='iconsLo' src={fileImg} alt="" />
                <input type="file" id="photoInput" name="photos[]" multiple accept="image/*" />
              </div>
            </div>
          </div>
          <div className='endSection'>
            <button className='Singup'><b>Upload</b></button>
            <p>Already have an account? <Link to={'/login'}><b>Login</b></Link></p>
          </div>
        </form>
      </div>

    </div>
  )
}

export default Addrestaurant
